function calculateDominicanPayroll(e){if("number"!=typeof e)return null;const t={threshold:34685,rate:.15,fixedAmount:0},o={threshold:52027.4167,rate:.2,fixedAmount:2601.33},l={threshold:72260.25,rate:.25,fixedAmount:6648},r=.0304*e,h=.0287*e,n=e-(r+h);let s=0;if(n>=l.threshold){const e=n-l.threshold;s=l.fixedAmount+e*l.rate}else if(n<l.threshold&&n>=o.threshold){const e=n-o.threshold;s=o.fixedAmount+e*o.rate}else if(n<o.threshold&&n>=t.threshold){const e=n-t.threshold;s=t.fixedAmount+e*t.rate}else s=0;return{monthlySalary:e,netMonthlySalary:n-s,sfs:r,afp:h,isr:s,deductions:r+h+s}}export default calculateDominicanPayroll;